import './App.css';
import Section from './components/section/Section';

window.addEventListener("resize", function() {
  if (window.innerHeight < 600) {
    window.resizeTo(window.innerWidth, 600);
  }
});

const App = () => {
  return (
    <div className="main">
      <div className='background' />
      <Section />
    </div>
  );
}

export default App;
